import React from 'react';
import Page from "./page";
import './Home.css';
import InfoCrypto from '../components/InfoCrypto';

const Home = () => (
	<Page>
		<h1>Home</h1>

		<div>
			<InfoCrypto/>
		</div>
	</Page>
);

export default Home;
